import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { userApi } from '../services/api';
import './LoginPage.css';

const apiBaseUrl = process.env.REACT_APP_API_BASE_URL || 'http://localhost:9090';

interface LoginFormData {
  phone: string; // 使用phone字段兼容后端API
  password: string;
}

const LoginPage: React.FC = () => {
  const [formData, setFormData] = useState<LoginFormData>({
    phone: '',
    password: ''
  });
  const [error, setError] = useState<string | null>(null);
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
    // 清除之前的错误信息
    if (error) setError(null);
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setLoading(true);
    setError(null);

    try {
      // 调用真实API - 使用新的login端点
      const response = await userApi.login({
        username: formData.phone, // 使用username字段，但保持变量名不变以兼容现有代码
        password: formData.password
      });

      console.log('Login response data:', response.data); // 调试日志

      if (response.data && response.data.code === 200) {
        // 登录成功，跳转到主页
        const token = response.data.token || response.data.data?.token;
        if (token) {
          localStorage.setItem('token', token);
        }
        navigate('/');
      } else {
        // 尝试从响应中获取错误消息
        // 优先显示 response.data.msg 或 message，如果没有则显示默认信息
        const serverMsg = response.data?.msg || response.data?.message;
        const errorMessage = serverMsg || 'ログインに失敗しました。再試行してください。';
        setError(errorMessage);
        console.error('Login failed response:', response.data);
      }
    } catch (err: any) {
      // 处理不同的错误情况
      if (err.response) {
        // 服务器响应错误
        switch (err.response.status) {
          case 401:
            setError('ユーザー名またはパスワードが間違っています。');
            break;
          case 404:
            setError('ユーザーが存在しません。');
            break;
          case 500:
            setError('サーバーエラーが発生しました。後ほど再試行してください。');
            break;
          default:
            setError(err.response.data?.message || 'ログインに失敗しました。再試行してください。');
        }
      } else if (err.request) {
        // 网络错误
        setError(`ネットワーク接続に失敗しました。バックエンド(${apiBaseUrl})が起動しているか確認してください。`);
      } else {
        // 其他错误
        setError(`エラー: ${err.message || '不明なエラー'} (URL: ${err.config?.url})`);
        console.error('Login error details:', err);
      }
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="login-page">
      <div className="login-container">
        <h2>ログイン</h2>
        {error && (
            <div className="error-message" style={{ wordBreak: 'break-all', fontSize: '12px' }}>
                {error}
                <br/>
                API Base: {process.env.REACT_APP_API_BASE_URL || '(empty)'}
            </div>
        )}

        <form onSubmit={handleSubmit} className="login-form">
          <div className="form-group">
            <label htmlFor="phone">ユーザー名またはメールアドレス</label>
            <input
              type="text"
              id="phone"
              name="phone"
              value={formData.phone}
              onChange={handleChange}
              placeholder="ユーザー名またはメールアドレスを入力"
              required
              className="form-input"
            />
          </div>

          <div className="form-group">
            <label htmlFor="password">パスワード</label>
            <input
              type="password"
              id="password"
              name="password"
              value={formData.password}
              onChange={handleChange}
              placeholder="パスワードを入力"
              required
              className="form-input"
            />
          </div>

          <button 
            type="submit" 
            className="login-button"
            disabled={loading}
          >
            {loading ? 'ログイン中...' : 'ログイン'}
          </button>
        </form>

        <div className="login-footer">
          <p>アカウントをお持ちでないですか？ <Link to="/register" className="link">新規登録</Link></p>
          <Link to="/" className="link">トップページへ戻る</Link>
        </div>
      </div>
    </div>
  );
};

export default LoginPage;
